import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View, Image } from "react-native";

export default function App() {
  return (
    <View style={styles.container}>
      <View style={styles.card}>
        <Image 
        source={require("./images/image-equilibrium.jpg")} 
        style={styles.nftImg}
        />
        <Text style={styles.title}>
        Equilibrium #3429
        </Text>
        <Text style={styles.Txt}>Our Equilibrium collection promotes balance and calm.</Text>
        <Text style={styles.eth}> 0.041 ETH</Text>
        <Text style={styles.Txt}>3 days left</Text>
        <View style={styles.card2}>
          <Image></Image>
          <Text style={styles.Txt}>Creation of </Text>
          <Text style={{color:'hsl(0, 0%, 100%)'}}>Jules Wyvern</Text>
        </View>

      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "hsl(217, 54%, 11%)",
    alignItems: "center",
    justifyContent: "center",
  },
  card: {
    height: "50vh",
    width: "17vw",
    backgroundColor: "hsl(216, 50%, 16%)",
    borderRadius:'2.5%',
    flex:2
  },
  title: {
    color: "hsl(0, 0%, 100%)",
  },
  nftImg: {
    height: "20vh",
    width: "15vw",
    borderRadius:'2.5%'
  },
  Txt:{
    color:'hsl(215, 32%, 27%)',
  }

});
